import React from "react";

import phone from "../images/phone.png";

const Header = () => {
  return (
    <div className="w-full">
      <div className="w-full mx-auto h-[30px] bg-black flex justify-between">
        <div>
          <img src={phone} alt="phone" />
          <p>+993 62 123456</p>
        </div>
      </div>
    </div>
  );
};

export default Header;
